insert into product  (availability, code, description, discardDate, pieces, price, promoImage, publishDate, rating, summary, title, brand_id, category_id) values ('IN_STOCK', 'Nl252j4c', '<h2 style="font-size: 23px; font-family: Arial, sans-serif; color: rgb(0, 39, 90); margin: 0px; background-color: rgb(255, 255, 253);">APPLE MacBook Pro 13" CZ</h2><div id="desc" style="margin-top: 10px; line-height: 1.5em; color: rgb(26, 23, 27); font-family: Verdana, sans-serif, Arial; background-color: rgb(255, 255, 253);">Cute compact notebook coming from the workshops of Apple, which has traditionally reflected in the impressive body design the most advanced components present time.In this notebook managed to combine delicate hardware with high computing power and also offers long battery life.Its design is traditionally simple, yet striking and very functional.Easily become your partner for everyday travel and undisturbed use of the functions.&nbsp;<br/><br/>The notebook chassis is made from a single piece of aluminum and therefore received the name "unibody".Aluminum chassis is extremely rigid and lightweight device provides resistance to shock and other unpleasant events.On his side, see the status lights, which will inform you about the state of the battery charge.&nbsp;<br/><br/>The heart is technologically dazzling laptop processor Intel Core i5 family of new Ivy Bridge.Compared to the predecessor lower consumption and higher operating frequencies.Comes in handy Intel Turbo Boost Technology 2, which at high loads automatically overclock the CPU and thus ensure reserve capacity.The notebook is equipped with a solid graphics card Intel HD Graphics 4000, which is fully integrated in the processor and provides a surprising multimedia performance many times greater than the previous generation.&nbsp;<br/><br/>Data stored on a hard disk capacity of 500 GB, or you can burn using DVD burner drive.Other accessories of this notebook is a slot for memory cards SDXC and FireWire 800