rd slot&nbsp;<br/>1x Power input - MagSafe&nbsp;<br/><br/><strong>Consumption:</strong>&nbsp;<br/>Li-Pol battery (63.5 Wh)&nbsp;<br/>Battery life up to 7 hours&nbsp;<br/>AC Adapter MagSafe 60 W&nbsp;<br/><br/><strong>Dimensions:</strong>&nbsp;<br/>325 x 227 x 24.1 mm&nbsp;<br/><br/><strong>Weight:</strong>&nbsp;<br/>2.06 kg&nbsp;<br/><br/><strong>Operating System:</strong>&nbsp;<br/>Apple Mac OS X Lion</div>', '2013-06-27 00:00:00', 3, 27099, , '2013-02-17 00:00:00', NULL, 'Notebook - Intel Core i5 2.5GHz Dual-Core Ivy Bridge, 13.3 "LED 1280x800, RAM 4GB, Intel Graphics HD 4000, 500GB 5400 rpm HDD, DVD, WiFi, Bluetooth 4.0, Webcam, USB 3.0, Thunderbolt port SDXC card reader, MAC OS X', 'APPLE MacBook Pro 13" CZ', 2, 2);
insert into product  (availability, code, description, discardDate, pieces, price, promoImage, publishDate, rating, summary, title, brand_id, category_id) values ('IN_STOCK', 'RQ112d2', '<h2 style="font-size: 23px; font-family: Arial, sans-serif; color: rgb(0, 39, 90); margin: 0px; background-color: rgb(255, 255, 253);">HTC Desire S (Saga) Silver</h2><div id="desc" style="font-size: 13px; margin-top: 10px; line-height: 1.5em; color: rgb(26, 23, 27); font-family: Verdana, sans-serif, Arial; background-color: rgb(255, 255, 253);"><div class="bold legend" style="font-size: 13px; font-weight: bold; margin: 20px 0px;">Servisované/ Použité zboží. Plně funkční. Balení nemusí obsahovat příslušenství.</div><div style="font-size: 13px;">Dílensky skvěle zpracovaný, prvotřídně vybavený, zkrátka&nbsp;perfektní dotykový&nbsp;telefon&nbsp;HTC&nbsp;Desire&nbsp;S určený pro náročné uživatele a&nbsp;pro&nbsp;komfortní plnění nejrůznějších&nbsp;prácovních činností&nbsp;i pro moderní cestovní zábavu. Skvěle poslouží pro servírování nejrůznějších informací, práci s internetem, prohlížení filmů či fotografií nebo třeba hraní her. Vše s operačním systémem Google&nbsp;Android 2.3.3&nbsp;vybavený paletou nejmodernějších funkcí a vlastností, které lze přizpůsobit Vašemu vkusu a jednoduše ho lze&nbsp;doplnit o&nbsp;další potřebné aplikace. Ovládání probíhá skrze 3,7" dotykový displej&nbsp;s rozlišením 480 x 800 bodů, jehož jas je řízen dle aktuálních světelných podmínek&nbsp;senzorem.&nbsp;<br/><br/>Chloubou HTC&nbsp;Desire S&nbsp;je fotoaparát pořizující snímky v rozlišení&nbsp;5&nbsp;Mpx&nbsp;s automatickým ostřením&nbsp;a bleskem pro optimálně zachycené snímky. Umožněn je také záznam videa v rozlišení až 720p (HD). Na druhé straně přístroje nechybí webová kamera pro pohodlné vedení videohovorů. Užitečnou vlastností je také integrovaná GPS navigace doplněná o kompas. Samozřejmostí je vestavěný multimediální přehrávač, aplikace pro organizaci času a potěší také FM rádio.&nbsp;<br/><br/>O svižný chod systému i aplikací se stará&nbsp;specializovaný 1 GHz procesor, jenž má k dispozici&nbsp;768 MB paměti RAM. Vnitřní paměť pro ukládání uživatelských dat s kapacitou 1,1 GB je možné rozšířit paměťovými kartami Micro SD. O napájení se stará Li-Ion akumulátor o kapacitě 1450 mAh slibující až 430 hodin v pohotovostním režimu nebo 590 minut hovoru. Jistě také potěší standardní rozhraní v podobě 3,5 mm jack konektoru, Bluetooth, WiFi a microUSB.<br/><br/><strong>Parametry a specifikace:<br/><br/>Podporované sítě:</strong><br/>GSM 850/ 900/ 1800/ 1900 MHz&nbsp;<br/>HSPA/WCDMA: 900/ 2100 MHz&nbsp;<br/><br/><strong>Displej:</strong><br/>3,7" dotykový&nbsp;(kapacitní)<br/>Rozlišení: 480 x 800 bodů<br/><br/><strong>Procesor:</strong><br/>1000 MHz<br/><br/><strong>Paměť:</strong><br/>Interní paměť s kapacitou 1,1 GB<br/>768&nbsp;MB RAM<br/>Slot pro paměťové karty micro SD (SD&nbsp;2.0 kompatibilní)<br/><br/><strong>Fotoaparát:</strong><br/>5 Mpx s autofokusem a bleskem<br/>Záznam videa v HD rozlišení 720p (1280 x 720&nbsp;bodů)<br/>Rozpoznání tváře, vestavěné efekty, geotagging<br/><br/><strong>Výbava:</strong><br/>Fotoaparát 5&nbsp;Mpx + webová kamera&nbsp;<br/>G-senzor<br/>Pohybový senzor<br/>Senzor osvětlení<br/>GPS&nbsp;<br/>Digitální kompas<br/>FM rádio<br/><br/><strong>Komunikace:<br/></strong>WiFi&nbsp;802.11 b/g/n&nbsp;<br/>Bluetooth 2.1 + EDR&nbsp;(A2DP, PBAP)<br/>3G&nbsp;modem (3G sítě až 14,4&nbsp;Mbps download/ 5,76 Mbps upload; EDGE&nbsp;sítě až 560 kbps)<br/><br/><strong>Rozhraní:<br/></strong>3,5 mm stereo audio jack<br/>Micro USB (5pin)<br/>Micro SD&nbsp;slot (SD&nbsp;2.0&nbsp;kompatibilní)<br/><br/><strong>Napájení:</strong><br/>Li-Ion akumulátor s kapacitou 1400 mAh<br/>Pohotovostní režim: až 430 hodin<br/>Doba hovoru: až 590 minut<br/><br/><strong>Operační systém:<br/></strong>Google Android 2.3.3 (s HTC&nbsp;Sense)<br/><br/><strong>Rozměry:</strong><br/>115 x&nbsp;59,8 x 11,63 mm<br/><br/><strong>Hmotnost:</strong><br/>130 g</div></div>', '2014-01-01 00:00:00', 3, 7003, , '2013-02-04 00:00:00', NULL, 'Mobilní telefon 3.7" 480x800, procesor 1GHz, RAM 768MB, interní paměť 1100MB, fotoaparát 5mpx, GPS, WiFi, Bluetooth, 3G, FM, microSD, microUSB, Android 2.3.3', 'HTC Desire S (Saga) Silver', 10, 5);
insert into product  (availability, code, description, discardDate, pieces, price, promoImage, publishDate, rating, summary, title, brand_id, category_id) values ('IN_STOCK', 'RI018jb', '<h2 style="font-size: 23px; font-family: Arial, sans-serif; color: rgb(0, 39, 90); margin: 0px; background-color: rgb(255, 255, 253);">iPhone 5 16GB černý</h2><div id="desc" style="font-size: 13px; margin-top: 10px; line-height: 1.5em; color: rgb(26, 23, 27); font-family: Verdana, sans-serif, Arial; background-color: rgb(255, 255, 253);"><div style="font-size: 13px;">iPhone 5 vám přináší spoustu nových skvělých prvků v zase o něco kompaktnějším šasi. Jeho pozoruhodně tenký design, nabídl stále dostatek prostoru pro větší displej a rychlejší procesor. Stejně jako nekompromisně rychlé bezdrátové přenosy, které ale nijak nepoznamenaly výdrž baterie. Zbrusu nová sluchátka jsou zase navržena tak, aby poskytovala špičkovou kvalitu přednesu a zároveň vám pohodlně padla. V novém iPhonu se jednoduše objevila celá řádka skvělých prvků, aby byl zase tím nejlepším chytrým telefonem na světě!<br/><br/><strong>Nejtenčí, nejlehčí a nejrychlejší v historii – to je iPhone 5</strong><br/>Je až neuvěřitelné, že tak štíhlý telefon jako iPhone 5 může nabídnout tolik skvělých funkcí. Větší displej, rychlejší procesor, nejnovější bezdrátové přenosy, 8MP fotoaparát iSight a spousta dalších prvků. Vše v nádherném hliníkovém šasi, které bylo navrženo a zpracováno s nebývalou precizností. Tělo iPhone 5 je pouze 7,6 mm tenké a váží 112 gramů, takže je o 18 procent tenčí a 20 procent lehčí než iPhone 4S. K dosažení takto skvělých hodnot bylo třeba zcela nově definovat každý detail a následně všechno spojit v dokonale fungující celek.<br/><br/><strong>4“ displej Retina – zobrazení, jež vám vyrazí dech</strong><br/>Vývojáři iPhone si dali pečlivě záležet, aby poskytli uživatelům přesně takovou velikost displeje, která ještě umožňuje pohodlné ovládání jednou rukou. Displej iPhone 5 je sice větší, než jaký naleznete u předcházejícího modelu. Šířka celého telefonu však zůstala stejná a s ní i skvělá manipulovatelnost a ovladatelnost. Současné máte ale více prostoru pro prohlížení veškerého obsahu. Zobrazení s 326 body na palec poskytuje tak hustou síť zobrazení, že vaše oko nedokáže rozlišit jednotlivé pixely. Impozantní rozlišení 1136 x 640 bodů dokáže navíc zobrazit až o 18 % více obsahu, než tomu bylo u iPhonu 4S. Barevná saturace se pak zlepšila o ohromujících 44 %, takže si můžete být jisti, že se zobrazení bude živé a současné dokonale realistické.<br/><br/><strong>Bezdrátová konektivita rychlosti blesku</strong><br/>iPhone 5 podporuje vysokorychlostní sítě HSPA, HSPA + a DC-HSDPA. Díky tomu můžete procházet internet, stahovat a streamovat obsah bez jakéhokoli čekání. Dvoupásmový modul Wi-Fi vám umožní využívat standardu 802.11n na frekvencích 2,4 i 5 GHz a přenášet tak data rychlostí až 150 Mbps a na mnohem větší vzdálenosti i v rušeném prostředí.<br/><br/><strong>Apple A6 - dvojnásobný výpočetní a grafický výkon</strong><br/>S novým procesorem A6 je všechno, co děláte na iPhone 5, znatelně rychlejší - oproti modelu A5 až dvojnásobě. Takže se aplikace spouštění webu, načítání stránek a e-mailových příloh zobrazují téměř okamžitě. Ruku v ruce s tím jde i dvojnásobný grafický výkon zajišťující dostatečnou podporu i pro náročné aplikace a hry. Vše si nyní vychutnáte s rychlejší frekvencí snímkování pro hladší a realističtější hraní.<br/><br/><strong>Ještě lepší výdrž baterie</strong><br/>Nejen že je čip A6 navržen tak, aby byl rychlý, zároveň je také extrémně úsporný. I Při jeho výkonnosti vám iPhone 5 poskytne podporu pro až 8hodinové surfování prostřednictvím&nbsp; sítě 3G či telefonování. Stejně jako až 10hodinové přehrávání videa.<br/><br/><strong>Zbrusu nová sluchátka</strong><br/>Vývojáři Apple testovali více než stovku návrhů a prototypů různých sluchátek, aby vytvořili špunty, které pohodlně sedí, zůstanou pevně v uchu i při sportovních aktivitách a zároveň produkují kvalitní zvuk. Výsledkem jsou Apple EarPods – ta nejlepší sluchátka od Apple, jaká jste kdy měli možnost slyšet. O zlepšené snímání zvuku samotného telefonu se zase stará hned trojice zabudovaných mikrofonů - jeden na přední straně, jeden na zadní straně a jeden dolní hraně. Přední a zadní mikrofony spolupracují na zpracování zvukových vln, které pomáhá iPhone 5 zaměřit zvuk a následně jej snímat s maximální čistotou a věrností. Zbrusu nová technologie redukce šumu pak snižuje šum na pozadí, takže si můžete být jisti, že osoba na druhém konci vás uslyší jasně a čistě.&nbsp;<br/><br/><strong>Fotoaparát iSight – zachycujte svět v ohromující kvalitě</strong><br/>Fotografie s 8megapixelového snímače vypadají tak skvěle, že je těžké uvěřit, že byly pořízeny „pouze“ mobilním telefonem. Všechna vylepšení z iPhone 4S, která učinila fotoaparát iSight světovou jedničkou zůstala zachována a navíc byla posunuta na ještě vyšší úroveň. Nová panoramatická funkce umožňuje zachytit vše v širokém detailu. Jedním plynulým pohybem, můžete zaznamenat prostor v rozsahu až 240 stupňů. Gyroskop, čip A6 a aplikace Camera app pak společně vytvoří panoramatický snímek s rozlišením až 28 milionů obrazových bodů.<br/><br/><strong>Nový konektor Lightning</strong><br/>Extrémně štíhlý a tenký design si vyžádal odstranění 30pinového dokovacího konektoru a jeho nahrazení moderním portem Lightning. Ten dokáže přenášet data ve znatelně vyšší kvalitě a zároveň je významně odolnější. Pokud však máte zakoupeno nějaké příslušenství s klasickým 30pinovým konektorem, nemusíte zoufat, k zakoupení je adaptérová redukce, která vám jej umožní připojit i k novému iPhonu 5.<br/><br/><strong>Parametry a specifikace:</strong><br/><br/><strong>Základní:</strong><br/>Procesor: Apple A6<br/>Operační systém: iOS 6<br/>Úložný prostor: 16 GB<br/><br/><strong>Podporované sítě:</strong><br/>GSM, EDGE, GPRS<br/>UMTS/HSPA+<br/>DC-HSDPA<br/>CDMA: CDMA EV-DO Rev. A a Rev. B<br/><br/><strong>Displej:</strong><br/>Typ: Retina, dotykový multi-touch<br/>Úhlopříčka: 4“<br/>Rozlišení: 1136 x 640 bodů<br/>Kontrast: 800:1<br/>Jas: 500 cd/m2<br/>Povrch displeje odolný proti mastnotě a ulpívání otisků prstů<br/><br/><strong>Senzory:</strong><br/>Tříosý gyroskop<br/>Akcelerometr<br/>Senzor přítomnosti<br/>Senzor okolního osvětlení<br/><br/><strong>Lokace:</strong><br/>Asistované GPS a GLONASS<br/>Digitální kompas, Wi-Fi, 3G<br/><br/><strong>Foto a video:</strong><br/>8pegapixelový fotoaparát iSight<br/>Funkce Panorama<br/>Nahrávání videa se zvukem v rozlišení Full HD 1080p a při 30 snímcích/s.<br/>HD kamera FaceTime se záznamem fotografií v rozlišení 1,2 megapixelu a snímáním videa v rozlišení HD 720p při 30 snímcích/s<br/>Autofocus (automatické ostření), Tap to focus, detekce tváře, LED blesk, vylepšená stabilizace videa, foto a video geotagging, pořizování fotografií v průběhu nahrávání videa<br/><br/><strong>Audio:</strong><br/>Formáty: AAC (8-320 Kbps), chráněné AAC (z iTunes Store), HE-AAC, MP3 (8-320 Kbps), MP3 VBR, Audible (formáty 2, 3, 4, Audible Enhanced Audio, AAX a AAX+), Apple Lossless, AIFF a WAV<br/>Uživatelsky konfigurovatelná maximální hlasitost<br/><br/><strong>TV a video:</strong><br/>Zrcadlení AirPlay na Apple TV v rozlišení 720p<br/>Přenos videa AirPlay na Apple TV (3. generace) až 1080p a Apple TV (2. generace) až 720p<br/>Podporované formáty: H.264 až 1080p při 30 snímcích/s, MPEG-4 640 x 480 bodů při 30 snímcích/s, Motion JPEG (M-JPEG) až 35 Mbps, 1280 x 720 bodů při 30 snímcích/s<br/><br/><strong>Rozhraní:</strong><br/>Wi-Fi (802.11a/b/g/n, 802.11n v pásmech<br/>2,4 GHz a 5 GHz)<br/>Bluetooth 4.0<br/>3,5mm výstup na sluchátka<br/>Lightning<br/><br/><strong>Napájení:</strong><br/>Vestavěný li-ion akumulátor (nabíjecí z PC nebo elektrické sítě)<br/>Doba hovoru: až 14 hodin ve 2G sítích nebo 8 hodin ve 3G<br/>Pohotovostní režim: až 225 hodin<br/>Prohlížení internetu: až 8 hodin v 3G síti nebo 10 hodin přes Wi-Fi<br/>Přehrávání videa: až 10 hodin<br/>Poslech hudby: až 40 hodin<br/><br/><strong>Provedení:</strong><br/>Barva: černá<br/>Rozměry: 123,8 x 58,6 x 7,6 mm<br/>Hmotnost: 112 g<br/><br/><strong>Příslušenství:</strong><br/>Sluchátka s dálkovým ovládáním a mikrofonem,&nbsp;USB napájecí adaptér,&nbsp;USB kabel pro připojení k PC, dokumentace</div></div>', '2014-02-04 00:00:00', 3, 18490, , '2013-02-04 00:00:00', NULL, 'Mobilní telefon - Apple A6 Dual-core 1GHz, dotykový 4" Retina 1136x640, interní paměť 16GB, WiFi 802.11a/b/g/n, Bluetooth 4.0, 8 Mpx fotoaparát s LED bleskem, GPS, Gyroskop, Akcelerometr, Lightning rozhraní, Sluchátka EarPods', 'iPhone 5 16GB černý', 2, 5);
insert into product  (availability, code, description, discardDate, pieces, price, promoImage, publishDate, rating, summary, title, brand_id, category_id) values ('IN_STOCK', 'WR243eh3', '<h2 style="font-size: 23px; font-family: Arial, sans-serif; color: rgb(0, 39, 90); margin: 0px; background-color: rgb(255, 255, 253);">32" Samsung UE32EH5000</h2><div id="desc" style="font-size: 13px; margin-top: 10px; line-height: 1.5em; color: rgb(26, 23, 27); font-family: Verdana, sans-serif, Arial; background-color: rgb(255, 255, 253);"><div style="font-size: 13px;">Televizor Samsung EH5000 řady 5 LED TV&nbsp;<strong>přenese velkolepé rozlišení Full HD přímo do vaší domácnosti</strong>. Můžete k němu&nbsp;<strong>připojit úložiště USB a přistupovat tak k filmům, hudbě a fotkám</strong>. Funkce&nbsp;<strong>Wide Color Enhancer Plus&nbsp;</strong>pak oživuje pomocí pokročilých algoritmů kvalitu obrazu a napomáhá k detailnějšímu a živějšímu zobrazení. Nebylo zapomenuto ani na ekologicky šetrný provoz, či minimalizaci oční únavy uživatelů. K dosažení uvedených cílů napomáhá&nbsp;<strong>integrovaný světelný senzor (Eco sensor).</strong><br/><br/><div style="font-size: 13px; text-align: center;"><img alt="" src="http://img.alza.cz/Foto/LegendFoto/306408_2.jpg" style="border: none; width: 750px; height: 234px;"/></div><br/><br/><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Špičková výbava i kvalita zpracování!</h3><br/>K připojení zdrojů s výstupem ve vysokém rozlišení vám poslouží&nbsp;<strong>dvojice vstupů HDMI</strong>, které doplňuje standardní sada analogových konektorů. Sledování si navíc budete moci vychutnávat bez ohledu okolní podmínky. Díky konstrukci&nbsp;<strong>Samsung Triple Protector</strong>&nbsp;obstojí model EH5000 i při provozu v těch nejnáročnějších a nejméně pohostinných podmínkách. Robustní vylepšené vnitřní obvody jsou chráněny proti přepětí a zkratu, stejně jako vlhkosti.&nbsp;<strong>Vyberte si televizi, která se dokáže vyrovnat s obtížnými podmínkami, takže budete moci vychutnat skvělý obraz bez obtíží!</strong><br/><br/><div style="font-size: 13px; text-align: center;"><img alt="" src="http://img.alza.cz/Foto/LegendFoto/306408_1.jpg" style="border: none; width: 750px; height: 259px;"/></div><br/><br/><strong>Parametry a Specifikace:</strong><br/><br/><strong>Vlastnosti displeje:</strong><br/>Úhlopříčka obrazovky: 32“ (80 cm)<br/>Rozlišení: 1920 x 1080 bodu<br/>Typ panelu: LCD<br/>Podsvícení: LED<br/>Zobrazovací frekvence: 50 Hz - Clear Motion Rate<br/>Další: Wide Colour Enhancer Plus<br/><br/><strong>Příjem TV signálu:</strong><br/>Analogový tuner<br/>DVB-T tuner pro příjem digitálního pozemního vysílání / HD DVB-T tuner pro příjem digitálního pozemního vysílání ve vysokém rozlišení (MPEG-4)<br/>DVB-C tuner pro příjem kabelové televize / HD DVB-C tuner pro příjem kabelové televize ve vysokém rozlišení (MPEG-4)<br/><br/><strong>Video vstupy a výstupy:</strong><br/>2x HDMI<br/>1x Komponentní (sdílený kanál Y pro kompozitní video)<br/>1x Kompozitní<br/>1x SCART<br/><br/><strong>Zvukové vstupy a výstupy:</strong><br/>Výstup na sluchátka<br/>Digitální optický výstup<br/>PC/DVI audio vstup<br/><br/><strong>Další výbava:</strong><br/>1x USB (hudba/video/fotky)<br/>Slot pro karty CI (Common Interface)<br/>Světelný senzor (Eco Sensor)<br/><br/><strong>Ozvučení:</strong><br/>Výkon reproduktoru 2x 10 W<br/>Technologie: Digital Dolby Plus / Dolby Pulse, SRS TheatreSound, dts 2.0+Digital Out, automatické vyvážení hlasitosti<br/><br/><strong>Další technologie:</strong><br/>Časovač zapnutí a vypnutí / hodiny / herní režim / 1 tunerový PIP / EPG a Teletext / digitální redukce šumu<br/><br/><strong>Údaje o spotřebě:</strong><br/>Typická spotřeba: 39 W<br/>Spotřeba ve Stand-by: 0,3 W<br/><br/><strong>Provedení televizoru:</strong><br/>Barva: černá<br/>Rozměry (Se stojanem): 738,3 x 498,2 x 191,7 mm (Š x V x H)<br/>Rozměry (Bez stojanu): 738,3 x 444,9 x 93,2 mm (Š x V x H)<br/>Hmotnost: (Se stojanem): 6,4 kg<br/>Hmotnost: (Bez stojanu): 5,7 kg<br/>VESA uchycení: 200 x 200 mm<br/><br/><strong>Dodávané příslušenství:</strong><br/>Dálkový ovladač</div></div>', '2014-02-01 00:00:00', 1, 7990, , '2013-02-01 00:00:00', NULL, 'Televize LED, úhlopříčka 80 cm, černá, 16:9, 1920x1080, 50Hz, HDTV DVB-T/ DVB-C, 2xHDMI, SCART, 1x USB (Audio, Foto, Video)', '32" Samsung UE32EH5000', 8, 4);
insert into product  (availability, code, description, discardDate, pieces, price, promoImage, publishDate, rating, summary, title, brand_id, category_id) values ('IN_STOCK', 'WK570r2', '<h2 style="font-size: 23px; font-family: Arial, sans-serif; color: rgb(0, 39, 90); margin: 0px; background-color: rgb(255, 255, 253);">47" LG 47LM640S</h2><div id="desc" style="font-size: 13px; margin-top: 10px; line-height: 1.5em; color: rgb(26, 23, 27); font-family: Verdana, sans-serif, Arial; background-color: rgb(255, 255, 253);"><div style="font-size: 13px;">Ponořte se do světa trojrozměrného obrazu s novou&nbsp;<strong>3D televizí&nbsp;LG 47LM640S</strong>&nbsp;s&nbsp;<strong>Cinema3D</strong>&nbsp;technologií a prémiovým designem. S vysokým rozlišením&nbsp;<strong>FullHD</strong>&nbsp;vám neunikne ze třetího rozměru žádný detail, vše bude maximálně ostré a detailní. Krásný a barevný obraz jako v kině doplňuje možnost&nbsp;<strong>konverze klasického 2D obsahu do 3D</strong>, přístup k exkluzivnímu 3D obsahu nebo možnost lokálního tlumení LED podsvícení<strong>.</strong>&nbsp;Dopřejte vašemu obývacímu pokoji vylepšení, jaké si zaslouží.<br/><br/><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Unikátní brýle LG CINEMA 3D</h3><br/>Zapomeňte na těžké a nepohodlné brýle. S novými&nbsp;<strong>LG CINEMA 3D</strong>&nbsp;pro vás bude sledování trojrozměrných filmů doslova požitek. Díky své malé váze&nbsp;<strong>se příjemně nosí a navíc stojí nesrovnatelně méně</strong>&nbsp;než 3D brýle konkurence. Pro uživatele s dioptrickými brýlemi připravilo LG speciální klipsu, takže se nemusí obávat, že by si 3D zážitek nemohli vychutnat naplno.<img alt="" src="http://img.alza.cz/foto/legendfoto/359529.jpg" style="border: none; padding: 10px 0px 20px 15px; width: 750px; float: right; height: 255px; margin-left: 2px; margin-right: 2px;"/><br/><br/><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Dopřejte vašim očím odpočinek a 3D obraz najednou</h3><br/>LG 47LM640S je&nbsp;<strong>ohleduplný k vašim očím</strong>, protože z obrazu&nbsp;<strong>odstraňuje nepříjemné blikání</strong>&nbsp;způsobené konvenčními 3D brýlemi, a vy si tak můžete užívat dlouhé filmové večery bez únavy a bolesti očí. Sledování 3D obrazu nikdy nebylo příjemnější.<img alt="" src="http://img.alza.cz/foto/legendfoto/359529_1.jpg" style="border: none; padding: 10px 0px 20px 15px; width: 750px; float: right; height: 255px; margin-left: 2px; margin-right: 2px;"/><br/><br/><img alt="" src="http://img.alza.cz/foto/legendfoto/359529_2.jpg" style="border: none; padding: 15px 0px 0px 20px; width: 200px; float: right; height: 144px; margin-left: 2px; margin-right: 2px;"/><div style="font-size: 13px; padding: 290px 0px 0px;"><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Nastavte si hloubku obrazu</h3><br/>Upravte si 3D zážitek přesně podle vašeho vkusu. Uživatelsky přívětivé prostředí vám umožní&nbsp;<strong>nastavit hloubku 3D efektu</strong>&nbsp;a vy si sami můžete zvolit, jestli dáte přednost většímu komfortu nebo většímu zážitku při sledování 3D obsahu.<br/><br/><img alt="" src="http://img.alza.cz/foto/legendfoto/359529_3.jpg" style="border: none; padding: 15px 20px 0px 0px; width: 200px; float: left; height: 144px; margin-left: 2px; margin-right: 2px;"/><div style="font-size: 13px; padding: 35px 0px 0px;"><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Obohaťte každý snímek o třetí rozměr</h3><br/>S televizí LG 47LM640S se vám klidně může stát, že při sledování fotbalového zápasu vyletí míč přímo do vašeho obýváku. Speciální funkce pro konverzi obrazu&nbsp;<strong>vylepší jakékoliv klasické 2D vysílání o třetí rozměr.</strong></div><img alt="" src="http://img.alza.cz/foto/legendfoto/359529_4.jpg" style="border: none; padding: 35px 0px 0px 20px; width: 200px; float: right; height: 144px; margin-left: 2px; margin-right: 2px;"/><div style="font-size: 13px; padding: 50px 0px 0px;"><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Hraní s DUAL PLAY</h3><br/>Hrajte na televizi hry ve dvou lidech, aniž byste potřebovali rozdělit obraz na dvě poloviny. S funkcí&nbsp;<strong>DUAL PLAY</strong>&nbsp;uvidí každý hráč svoji část hry na celé ploše televize. Brýle DUAL PLAY je nutné dokoupit zvlášť.</div><img alt="" src="http://img.alza.cz/foto/legendfoto/359529_6.jpg" style="border: none; padding: 45px 20px 0px 0px; width: 200px; float: left; height: 144px; margin-left: 2px; margin-right: 2px;"/><div style="font-size: 13px; padding: 60px 0px 0px;"><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Inovativní ovládání</h3><br/>Dálkový ovladač<strong>&nbsp;Magic Remote Control&nbsp;</strong>(nutno dokoupit)<strong>&nbsp;</strong>přináší nové intuitivní ovládání vaší televize. Zapomeňte na spoustu nepoužívaných tlačítek a vyzkoušejte si pokročilý a pohodlný způsob ovládání. K dispozici máte 3 režimy: Kurzor, Gesto a Kolečko.<br/>&nbsp;</div><img alt="" src="http://img.alza.cz/foto/legendfoto/359529_7.jpg" style="border: none; padding: 40px 0px 0px 20px; width: 200px; float: right; height: 144px; margin-left: 2px; margin-right: 2px;"/><div style="font-size: 13px; padding: 30px 0px 0px;"><h3 style="margin: 0px; font-size: 21px; font-family: Arial, sans-serif; color: rgb(47, 141, 205);">Úchvatné barvy a vysoký kontrast</h3><br/>Funkce&nbsp;<strong>Macro Pixel Control&nbsp;</strong>dokáže provádět&nbsp;<strong>lokální tlumení podsvícení</strong>LED diod. Ovládáním jednotlivých LED bloků je možné dosáhnout mnohem<strong>vyššího kontrastu a barevného rozsahu.</strong>&nbsp;Černá tak bude opravdu černá a vy navíc ušetříte peníze za elektřinu.</div></div><br/><strong>Parametry a specifikace:</strong><br/><br/><strong>Vlastnosti displeje:</strong><br/>Úhlopříčka obrazovky: 47" (120 cm)<br/>Rozlišení: 1920 x 1080 bodů<br/>Typ panelu: Cinema 3D LCD (pasivní 3D, včetně konverze 2D/3D)<br/>Podsvícení: LED<br/>Zobrazovací frekvence: 400 Hz - Motion Clarity Index<br/>Další: 3D XD Engine<br/><br/><strong>Příjem TV signálu:</strong><br/>DVB-T tuner pro příjem digitálního pozemního vysílání / HD DVB-T tuner pro příjem digitálního pozemního vysílání ve vysokém rozlišení (MPEG-4)<br/>DVB-C tuner pro příjem kabelové televize / HD DVB-C tuner pro příjem kabelové televize ve vysokém rozlišení (MPEG-4)<br/>DVB-S tuner pro příjem satelitní televize / HD DVB-S2 tuner pro příjem satelitní televize ve vysokém rozlišení (MPEG-4)<br/><br/><strong>Video vstupy a výstupy:</strong><br/>4x HDMI v1.4 (na bočním panelu)<br/>1x VGA (D-SUB)<br/>1x Komponentní<br/>1x SCART<br/><br/><strong>Zvukové vstupy a výstupy:</strong><br/>Výstup na sluchátka<br/>Digitální optický výstup<br/>PC audio vstup<br/><br/><strong>Další výbava</strong>:<br/>3x USB (DivX HD, JPEG, AC3(Dolby Digital), EAC3, HAAC, AAC, Mpeg, MP3, PCM, DTS)<br/>Záznam digitálního vysílání (pouze na externí pevný disk)<br/>Funkce sledování s časovým posuvem TimeShift<br/>Slot pro karty CI+ (Common Interface)<br/>Ethernetový vstup (Podporuje DLNA)<br/>WiFi<br/>WiFi Direct, WiDi<br/>Simplink<br/>DLNA<br/><br/><strong>Ozvučení:</strong><br/>Výkon reproduktorů: 2x 10 W<br/>Technologie: Prostorový zvuk, Clear Voice 2<br/><br/><strong>Další technologie:</strong><br/>EPG a Teletext / SMART TV (plnohodnotný internetový prohlížeč, prémiové aplikace, App store) / podpora chytrých telefonů s OS Android / PIP (obraz v obraze – v režimu web. prohlížeče) / technologie Smart energy saving PLUS (úspora energie s možností vypnout obraz) / průvodce obrazovým nastavením - Picture Wizard II / dětská pojistka / budík / časovač vypnutí / automatické vypnutí / podpora Skype (vyžaduje dokoupit kameru)<br/><br/><strong>Údaje o spotřebě:</strong><br/>Typická spotřeba: 63 W<br/>Spotřeba ve Stand-by: 0,3 W<br/>Energetická třída: A+<br/><br/><strong>Provedení televizoru:</strong><br/>Rozměry (Se stojanem): 1073 x 639 x 263 mm (Š x V x H)<br/>Rozměry (Bez stojanu): 1073 x 705 x 35,2 mm (Š x V x H)<br/>Hmotnost (Se stojanem): 16,9 kg<br/>Hmotnost (Bez stojanu): 14,7 kg<br/>VESA uchycení: 400 x 400 mm<br/><br/><strong>Dodávané příslušenství:</strong><br/>Televizor<br/>Dálkový ovladač<br/>4x polarizační Cinema 3D brýle</div></div>', '2015-02-01 00:00:00', 2, 23490, , '2013-02-01 00:00:00', NULL, 'Televize Cinema 3D LED, úhlopříčka 120cm, 2D-3D konverze, FullHD 1920x1080, HD DVB-T/C/S2, DVR, 4xHDMI, 3xUSB, Scart, LAN, WiFi, WiDi, DLNA, SMART TV, DualPlay + 4x 3D brýle (Dual Play brýle nejsou součástí balení)', '47" LG 47LM640S', 9, 4);
insert into product  (availability, code, description, discardDate, pieces, price, promoImage, publishDate, rating, summary, title, brand_id, category_id) values ('SOLD_OUT', 'WS962c51', '<h2 style="font-size: 23px; font-family: Arial, sans-serif; color: rgb(0, 39, 90); margin: 0px; background-color: rgb(255, 255, 253);">40" Sharp LC-40LE830E</h2><div id="desc" style="font-size: 13px; margin-top: 10px; line-height: 1.5em; color: rgb(26, 23, 27); font-family: Verdana, sans-serif, Arial; background-color: rgb(255, 255, 253);"><div style="font-size: 13px;">3D televizor Sharp AQUOS LC-40LE830E využívá nejnovější technologii zobrazování, díky níž vám poskytne ten nejlepší možný obrazový zážitek, bez ohledu na to, zda se jedná o obraz 2D nebo 3D. Obraz se svými přirozenými barvami je skutečně jako živý, má bohatý kontrast a hloubku, která bere dech. A co víc, spotřeba energie AQUOS LE830 je nejnižší ve své třídě. Tento TV je 3D Ready a může rovněž konvertovat programy 2D na simulované 3D.<br/><br/>Naprostou unikátním rysem tohoto štíhlého modelu je technologie Quattron umožňující rozlišení 1920 x 1080 x 4 a věrnou reprodukci barev a zobrazení jemných detailů. Jmenovaná technologie nově přidává žlutou k třem RGB základním barvám (červená, zelená, modrá). Tato kombinace rozšiřuje barevné spektrum a umožňuje zobrazit věrně barvy, které do té doby bylo nemožné reprodukovat, především třpytivě zlatou a slunečnicově žlutou. 200 Hz zobrazovací frekvence poté zlepšuje jasnost obrazu a hladkost přechodů u filmů a sportovních přenosů.<br/><br/>Zvukový doprovod při sledování televizních pořadů i filmů z optických disků obstará dvojice reproduktorů a subwoofer. Rozhraní televizoru potěší čtveřice HDMI vstupů ve verzi 1.4. Nechybí užitečný USB port, který rozšiřuje funkce televizoru o přímé přehrávání videí, hudby i obrázků z přenositelných datových úložišť.<br/><br/>AQUOS LC-40LE830E obsahuje veškeré obrazové tunery pro analogové i digitální vysílání. Naleznete v něm SD i HD tunery pro příjem pozemní, satelitní i kabelové televize, které doplňuje CI slot pro umožňující příjem kódovaných programů. Televizor obsahuje standardní LAN konektor, ale nechybí mu ani integrovaný WiFi adaptér. S jeho prostřednictvím můžete přehrávat různý multimediální obsah a prostřednictvím volitelné kamery také telefonovat přes Skype. Rozšířenou paletu funkcí doplňuje senzor pro automatickou regulaci podsvětlení obrazovky v závislosti na okolních podmínkách, či SD slot pro záznam videa na paměťové karty.<br/><br/><strong>Parametry a Specifikace:</strong><br/><br/><strong>Vlastnosti displeje:</strong><br/>Úhlopříčka obrazovky: 40“ (102 cm)<br/>Rozlišení: 1920 x 1080 bodů<br/>Typ panelu: LCD - 3D/UV2A<br/>Podsvícení: LED<br/>Dynamický kontrast: velmi vysoký kontrast<br/>8bitová barevná hloubka<br/>Zobrazovací frekvence: 200 Hz&nbsp;<br/><br/><strong>Příjem TV signálu:</strong><br/>Analogový tuner<br/>DVB-T tuner pro příjem digitálního pozemního vysílání / HD DVB-T tuner pro příjem digitálního pozemního vysílání ve vysokém rozlišení (MPEG-4)<br/>DVB-C tuner pro příjem kabelové televize / HD DVB-C tuner pro příjem kabelové televize ve vysokém rozlišení (MPEG-4)<br/>DVB-S tuner pro příjemsatelitní televize / HD DVB-S2 tuner pro příjem satelitní televize ve vysokém rozlišení (MPEG-4)<br/><br/><strong>Video vstupy a výstupy:</strong><br/>4x HDMI v1.4 s podporou 3D a zpětného kanálu audia<br/>1x VGA (D-SUB)<br/>1x Komponentní<br/>1x Kompozitní<br/>1x SCART<br/><br/><strong>Zvukové vstupy a výstupy:</strong><br/>Výstup na sluchátka&nbsp;<br/>Digitální optický výstup<br/>Analogové audio<br/><br/><strong>Další výbava:</strong><br/>1x USB (video/foto/hudba)<br/>Slot pro karty CI (Common Interface)<br/>Čtečka paměťových karet SD (pouze pro ukládání videa)<br/>Ethernetový vstup (Podporuje DLNA)<br/>WiFi<br/>Světelný senzor<br/><br/><strong>Ozvučení:</strong><br/>Výkon reproduktorů 2x 10 W<br/>Subwoofer: 15 W<br/>Technologie: Virtuální / Dolby Surround, Automatické ovládání hlasitosti AVC<br/><br/><strong>Další technologie:</strong><br/>AQUOS NET + / Teletext (stránky): 2000 / Elektronický průvodce programy (EPG): 7 dní, 3 pohledy, žánry, časovač (není určen pro nahrávání) / ukládání videa (vyžadována SD karta a Aquos Net+) / časový posun najednotkce USB / DLNA media player pro video/foto /hudbu / USB media player pro video/foto/hudbu / přehrávač pro Divx HD a DivX / Skype ready / VYP bez signálu, VYP bez provozu / Zabudovaný USB WLAN dongle<br/><br/><strong>Údaje o spotřebě:</strong><br/>Typická spotřeba: 63 W<br/>Spotřeba ve Stand-by: 0,20 W<br/><br/><strong>Provedení televizoru:</strong><br/>Barva: černá<br/>Rozměry (Se stojanem): 938 x 636 x 264 mm (Š x V x H)<br/>Rozměry (Bez stojanu): 938 x 588 x 34 mm (Š x V x H)<br/>Hmotnost: (Se stojanem): 16,5 kg<br/>Otočný podstavec<br/>VESA uchycení: 300 x 300 mm<br/><br/><strong>Dodávané příslušenství:</strong><br/>Dálkový ovladač</div></div>', '2014-01-01 00:00:00', 0, 15499, , '2013-01-02 00:00:00', NULL, 'Televize 3D LED, úhlopříčka 102 cm, černá, 200Hz, Full HD 1920x1080x4, DVB-S/T/C MPEG4 tuner, 4xHDMI, USB, AQUOS NET + Internetový přístup', '40" Sharp LC-40LE830E', 9, 4);
